/////////////////////////////////////////
// HERO CANVAS PORTRAIT (RESUME)
/////////////////////////////////////////

const image = new Image()
image.src =
  'data:image/png;base64,'

// EventListener to assure image loads correctly
image.addEventListener('load', function () {
  const canvas = document.getElementById('canvasPortraitHeader')
  const ctx = canvas.getContext('2d')
  canvas.width = 556
  canvas.height = 712

  // particlesArray , number of particles and detail (density of grid scanned)
  let particlesArray = []
  const numberOfParticles = 10000
  const detail = 1

  // image draw and remove
  ctx.drawImage(image, 0, 0, canvas.width, canvas.height)
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height)
  ctx.clearRect(0, 0, canvas.width, canvas.height)

  //grid that scans canvas and saves rb values and brightness in row array inside grid array
  let grid = []
  for (let y = 0; y < canvas.height; y += detail) {
    let row = []
    for (let x = 0; x < canvas.width; x += detail) {
      const index = y * 4 * pixels.width + x * 4
      const red = pixels.data[index]
      const green = pixels.data[index + 1]
      const blue = pixels.data[index + 2]
      // const color = 'rgb(' + red + ',' + green + ',' + blue + ')'
      const brightness = calculateBrightness(red, green, blue) / 100

      row.push(brightness)
    }
    grid.push(row)
  }

  // particle class
  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width
      this.y = 0
      this.speed = 0
      this.velocity = Math.random() * 0.7
      this.size = Math.random() * 1 + 0.1
    }
    update() {
      this.speed =
        grid[Math.floor(this.y / detail)][Math.floor(this.x / detail)] // math.floor to make whole numbers for array read
      let movement = 2.5 - this.speed + this.velocity
      this.y += movement
      if (this.y >= canvas.height) {
        this.y = 0
        this.x = Math.random() * canvas.width
      }
    }
    draw() {
      ctx.beginPath()
      ctx.fillStyle = 'white'
      ctx.arc(this.x, this.y, this.size, 0, 2 * Math.PI)
      ctx.fill()
    }
  }
  // initialize function (pushing particles into particles array)
  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particlesArray.push(new Particle())
    }
  }
  init()

  // animation function
  function animate() {
    ctx.globalAlpha = 0.05
    ctx.fillStyle = 'rgb(0, 0, 0)'
    ctx.fillRect(0, 0, canvas.width, canvas.height)
    ctx.globalAlpha = 0.2
    for (let i = 0; i < particlesArray.length; i++) {
      particlesArray[i].update()
      ctx.globalAlpha = particlesArray[i].speed * 0.3
      particlesArray[i].draw()
    }
    requestAnimationFrame(animate)
  }
  animate()

  // calculate brightness for color accurate brightness values because rgb have different brightness
  function calculateBrightness(red, green, blue) {
    return Math.sqrt(
      red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
    )
  }
})
